INSERT INTO `v1_1eeaaf2833d8faaa396a28284370d96596b91bf4a6c0326c73b4c8c638fda946` VALUES ("ダメージ減衰", 92411340, 18, "すべてのモンスターが一度の行動で受けるダメージ値を減衰させる。ダメージ値が上昇するほど減衰率も上昇する。", 490);
INSERT INTO `v1_1eeaaf2833d8faaa396a28284370d96596b91bf4a6c0326c73b4c8c638fda946` VALUES ("ＴＰ上昇上限付与", 92411340, 17, "バトル開始時、すべてのキャラのＴＰ上昇の上限値を150にする。", 491);
INSERT INTO `v1_1eeaaf2833d8faaa396a28284370d96596b91bf4a6c0326c73b4c8c638fda946` VALUES ("ＨＰ吸収ダウン", 92411340, 9, "バトル開始時、すべてのキャラのＨＰ吸収を中ダウンさせる。", 492);
